	public function uploading(){
		if($this->session->userdata("roleid") == 1){
			set_time_limit(0);
			$pmrs_patient 					= array(); // store patient not found in the table
			$total_outside_patient 			= 0;
			$total_pmrs_patient 			= 0;
			$total_patient_sample_tests 	= 0;
			$total_ptest_result				= 0;
			$total_ptest_result_antibiotic 	= 0;
			$total_patient_sample_detail 	= 0;
			$pmrs_in_db						= 0;
			$pmrs_not_found					= 0;
			$old_patient_sample_id			= array();

			$tbl_patient_sample = $this->data['camlis_patient_sample'];
			for($i = 0 ; $i < count($tbl_patient_sample) ; $i++){
				echo $i.") Patient Sample"."<br />";
				$old_psid 			= $tbl_patient_sample[$i]['ID'];
				$old_pid  			= $tbl_patient_sample[$i]['patient_id'];
				$lab_id   			= $tbl_patient_sample[$i]['labID'];
				$isPMRSPatientID 	= isPMRSPatientID($old_pid);
				echo "&emsp; Patient ID: ".$old_pid."<br />";
				if($isPMRSPatientID){	
					$new_pid = $old_pid;
					$check = $this->pmrs_exist($old_pid); // check in database
					if(!$check){
						$patient_data = $this->get_pmrs_patient($old_pid);
						if($patient_data){
							$isSavePMRS = $this->save_pmrs_patient($patient_data);
							if($isSavePMRS){
								$total_pmrs_patient++;
								echo '&emsp;&emsp;Saving PMRS patient: <span style="backgroud-color:#0af30a">SUCCESS</span> <br />';
							}else{
								echo '&emsp;&emsp;Save PMRS patient <span style="backgroud-color:red">FAIL<span><br />';
							} 
						}else{
							echo "&emsp;&emsp; not found in the table...!!! "."<br />";
							array_push($pmrs_patient,$old_pid);
							$pmrs_not_found++;
						}
					}else{
						$pmrs_in_db++;
						echo "&emsp;&emsp; already exist in DB<br />";
					}
				}else{
					// is outside patient
					$patient_data 	= $this->get_outside_patient_by_patient_code($lab_id , $old_pid);
					if($patient_data) {
						echo "&emsp;&emsp; patiend ID already exist in the LAB ".$lab_id." <br />";
						$new_pid = $patient_data['pid'];
					}else{
						// Check if patient exist in the lab
						$pdata 		  = $this->get_outside_patient_from_tbl($old_pid); // get data from array and used it to search 
						$patient_data = $this->get_outside_patient_by_data($pdata);
						if($patient_data){
							echo "&emsp;&emsp; Outside Patient Data already exist in DB <br />";
							echo '<div style="overflow-x: auto; height: 80px; margin-left: 40px; background-color: lightgray;">';
							echo "<pre>";
							print_r($patient_data);
							echo "</pre>";
							echo '</div>';
							$new_pid = $patient_data['pid'];
						}else{
							// Insert outside patient to obtain new ID
							$pdata 	 = array_slice($pdata,1); // remove attribute ID
							$new_pid = $this->save_outside_patient($pdata);
							if($new_pid){
								$total_outside_patient++;
								echo '&emsp;&emsp;Save outside patient: <span style="background-color: lightgray;">SUCCESS</span> '.$new_pid.'<br />';
							}else{
								echo '&emsp;&emsp;Unable to save outside patient: <span style="background-color: red;">FAIL</span>'.$old_pid.'<br />';
							}
						}
					}
				} // End patient
				$tbl_patient_sample[$i]['patient_id'] = $new_pid; // reset patient id

				// Sample number
				$sample_number = $tbl_patient_sample[$i]['sample_number'];	
				echo "&emsp; Sample number: ".$sample_number."<br />";
				if($this->check_sample_number($lab_id , $sample_number)){					
					$sample_number .= "A"; // add A as postfix 
					echo "&emsp;&emsp; Sample number Exist: ==> ".$sample_number."<br />";
				} // End sample number
				//Clinical history
				$tbl_patient_sample[$i]['clinical_history'] = strlen($tbl_patient_sample[$i]['clinical_history']) > 100 ? substr($tbl_patient_sample[$i]['clinical_history'],0,98) : $tbl_patient_sample[$i]['clinical_history'];
				
				$is_printed = $tbl_patient_sample[$i]['is_printed'];
				if($is_printed == 0) $tbl_patient_sample[$i]['is_printed'] = false;
				else if($is_printed == 1) $tbl_patient_sample[$i]['is_printed'] = true;

				$verify = $tbl_patient_sample[$i]['verify'];
				if($verify == 0 || $verify == 1) $tbl_patient_sample[$i]['verify'] = false;
				else if($verify == 2) $tbl_patient_sample[$i]['verify'] = true;
				

				// Check patient sample exit 
				$psample_data 			= $tbl_patient_sample[$i];
				$psample_data 			= array_slice($psample_data,1); // remove attribute ID
				$check_patient_sample 	= $this->is_patient_sample_exist($psample_data); // Check if patient sample data already exist in DB
				
				if(!$check_patient_sample){
					// Insert new patient sample	
					$psample_data['sample_number'] = $sample_number;
					$new_psample_id = $this->save_patient_sample($psample_data);
					if($new_psample_id){
						echo '&emsp;&emsp;Saving Patient Sample <span style="background-color: #0af30a;">SUCCESS</span> : '.$new_psample_id.'<br />';
						//camlis_patient_sample_tests
						$psample_tests = $this->get_patient_sample_tests($old_psid); // get patien sample test from table
						if($psample_tests){
							echo "&emsp;&emsp; Patient Sample Tests: ".count($psample_tests)." Tests found... <br />";
							for($j = 0 ; $j < count($psample_tests); $j++){
								$old_psample_test_id 					= $psample_tests[$j]['ID'];
								$psample_tests[$j]['patient_sample_id'] = $new_psample_id;
								$psample_tests[$j]['is_rejected'] 		= $psample_tests[$j]['is_rejected'] == 1 ? true : false;
								$psample_tests[$j]['is_show'] 			= $psample_tests[$j]['is_show'] == 1 ? true : false;
								//Save patient sample tests
								$psample_tests_data  = $psample_tests[$j];
								$psample_tests_data	 = array_slice($psample_tests_data,1); // remove attribute ID
								$new_psample_test_id = $this->save_psample_test($psample_tests_data);
								if($new_psample_test_id){
									// camlis ptest result
									$total_patient_sample_tests++;
									echo '&emsp;&emsp;&emsp; Saving Tests <span style="background-color: #0af30a;">SUCCESS</span>: '.$new_psample_test_id.'<br />';
									$ptest_result_data = $this->get_ptest_result($old_psample_test_id);
									if($ptest_result_data){
										for($k = 0 ; $k < count($ptest_result_data) ; $k++){
											$old_presult_id = $ptest_result_data[$k]['ID'];
											$ptest_result_data[$k]['patient_sample_id'] = $new_psample_id;
											$ptest_result_data[$k]['patient_test_id'] 	= $new_psample_test_id;
											$ptest_result 	= $ptest_result_data[$k];
											$ptest_result	= array_slice($ptest_result,1); // remove attribute ID
											$new_presult_id = $this->save_ptest_result($ptest_result);
											if($new_presult_id){
												$total_ptest_result++;
												//camlis ptest_result_antibiotic
												echo '&emsp;&emsp;&emsp;&emsp; Saving Result of the Test <span style="background-color: #0af30a;">SUCCESS</span>: '.$new_presult_id.'<br />';
												$ptest_result_antibiotic_data = $this->get_ptest_result_antibiotic($old_presult_id);
												if($ptest_result_antibiotic_data){
													for($z = 0 ; $z < count($ptest_result_antibiotic_data) ; $z++){
														$status = $ptest_result_antibiotic_data[$z]['status'];														
														$status = $status == 1 ? true : false;
														$ptest_result_antibiotic_data[$z]['status'] 	= $status;
														$ptest_result_antibiotic_data[$z]['presult_id'] = $new_presult_id;
														$ptest_result_antibiotic = $ptest_result_antibiotic_data[$z];
														$ptest_result_antibiotic = array_slice($ptest_result_antibiotic,1); // remove attribute ID
														if($this->save_ptest_result_antibiotic($ptest_result_antibiotic)){
															$total_ptest_result_antibiotic++;
															echo '&emsp;&emsp;&emsp;&emsp;&emsp; Saving ptest result antibiotic <span style="background-color: #0af30a;">SUCCESS</span><br />';
														}else{
															echo '&emsp;&emsp;&emsp;&emsp;&emsp; Unable to ptest result antibiotic <span style="background-color: red;">FAIL</span>: <br />';
															echo '<div style="overflow-x: auto; height: 80px; margin-left: 100px; background-color: lightgray;">';
															echo "<pre>";
															print_r($ptest_result_antibiotic);
															echo "</pre>";
															echo '</div>';
														}
													}
												}
											}else{
												echo '&emsp;&emsp;&emsp;&emsp; Unable to save Result of the Test <span style="background-color: red;">FAIL</span>: <br />';
												echo '<div style="overflow-x: auto; height: 80px; margin-left: 40px;">';
												print_r($ptest_result);
												echo '</div>';
											}
										}
									}else{
										echo '&emsp;&emsp;&emsp;&emsp; No Result of the Test found....<br />';
									}
								}else{
									echo '&emsp;&emsp;&emsp; Saving Tests <span style="background-color: red;">FAIL</span>: <br />';
								}
							}
						}else{
							echo "&emsp;&emsp; No Tests found ...[OLD PSample ID: ".$old_psid."]<br />";
							array_push($old_patient_sample_id,array('old_psample_id' => $old_psid , 'new_psample_id' => $new_psample_id));
						}

						// camlis patient sample detail
						$psample_detail_data = $this->get_psample_detail($old_psid);
						if($psample_detail_data){
							for($x = 0 ; $x < count($psample_detail_data) ; $x++){
								$status = $psample_detail_data[$x]['status'];
								if($status == 0) $status = false;
								else if ($status == 1) $status = true;
								$psample_detail_data[$x]['status'] = $status;
								$psample_detail_data[$x]['patient_sample_id'] = $new_psample_id;
								$psample_detail = $psample_detail_data[$x];
								$psample_detail	= array_slice($psample_detail,1); // remove attribute ID
								if($this->save_psample_detail($psample_detail)){
									$total_patient_sample_detail++;
									echo '&emsp;&emsp;&emsp;Save patient sample detail <span style="background-color: #0af30a;">SUCCESS</span><br />';
								}else{
									echo '&emsp;&emsp;&emsp;Unable to save patient sample detail <span style="background-color: red;">FAIL</span><br />';
									echo '<div style="overflow-x: auto; height: 60px; margin-left: 20px; background-color: lightgray;">';
									echo "<pre>";
									print_r($psample_detail);
									echo "</pre>";
									echo '</div>';
								}
							}
						}else{
							echo "&emsp;&emsp;&emsp;No patient sample detail found ... [OLD PSample ID: ".$old_psid."]<br />";
						}
					}else{
						echo '&emsp;&emsp;Unable to save patient sample <br />';
						echo '<div style="overflow-x: auto; height: 80px; margin-left: 20px; background-color: lightgray;">';
						echo "<pre>";
						print_r($psample_data);
						echo "</pre>";
						echo '</div>';
					}
				}else{
					echo "&emsp; Patient Sample alreay exist in DB<br />";
					echo '<div style="overflow-x: auto; height: 80px; margin-left: 20px; background-color: lightgray;">';
					echo "<pre>";
					print_r($check_patient_sample);
					echo "</pre>";
					echo '</div>';
				}
			} // End for
			
			echo "<h2>List of PMRS which does not find in the Table</h2> <br />";
			echo '<div style="overflow-x: auto; height: 120px; margin-left: 20px; background-color: lightgray;">';
			echo "<pre>";
			print_r($pmrs_patient);
			echo "</pre>";
			echo '</div>';
			echo '<h3>camlis_pmrs_patient ['.count($this->data['camlis_pmrs_patient']).']: '.$total_pmrs_patient.' | in DB: '.$pmrs_in_db.' | not found in table: '.$pmrs_not_found.'</h3>';
			echo '<h3>camlis_outside_patient ['.count($this->data['camlis_outside_patient']).']: '.$total_outside_patient.'</h3>';
			echo '<h3>camlis_patient_sample_tests ['.count($this->data['camlis_patient_sample_tests']).'] '.$total_patient_sample_tests.'</h3>';
			echo '<h3>camlis_ptest_result ['.count($this->data['camlis_ptest_result']).']: '.$total_ptest_result.'</h3>';
			echo '<h3>camlis_ptest_result_antibiotic ['.count($this->data['camlis_ptest_result_antibiotic']).'] '.$total_ptest_result_antibiotic.'</h3>';
			echo '<h3>camlis_patient_sample_detail ['.count($this->data['camlis_patient_sample_detail']).']: '.$total_patient_sample_detail.'</h3>';
		}
	}
